class Ipv6Address:
    def __init__(self, address: bytearray):
        assert len(address) == 16, address
        # I chose to store the address as the Big Int, because
        # it occupies less memory compared to bytearray in Python:
        # 232 (big int) vs 288 (bytearray)
        self.int_ = int.from_bytes(address, byteorder='big', signed=False)

    def __str__(self) -> str:
        parts = []
        addr = self.int_
        for _ in range(8):  # 8 groups of 2 bytes each
            v = addr & 0xFFFF
            part = '{:02X}'.format(v).removeprefix('0x').zfill(4)
            parts.append(part)
            addr >>= 16
        ret = ':'.join(reversed(parts))
        return ret

    def as_int(self) -> int:
        return self.int_

def addr_from_string(address: str) -> Ipv6Address:
    # example: 2345:0425:2CA1:0000:0000:0567:5673:23b5
    parts = address.split(':')
    ls = []
    for i in range(8):
        if i < len(parts) and parts[i] != '':
            part = bytearray.fromhex(parts[i])
        else:
            part = '0x0000'
        ls.append(part)
    assert len(ls) == 8, ls
    return Ipv6Address(b''.join(ls))

class Ipv6Network:
    def __init__(self, addr:Ipv6Address, network_mask_bits:int):
        self.addr = addr
        self.network_mask_bits = network_mask_bits

    def __str__(self):
        return str(self.addr) + '/' + str(self.network_mask_bits)

    def contains(self, addr: Ipv6Address) -> bool:
        '''Returns True if the given address is within this network.'''
        my_addr_as_int = self.addr.as_int()
        low_bits = 128 - self.network_mask_bits
        network_bits = my_addr_as_int >> low_bits
        address_bits = addr.as_int() >> low_bits
        return network_bits == address_bits

def main():
    addr1 : Ipv6Address = addr_from_string('0A0B:0001:0000:0000:0000:0000:0000:FF00')
    addr2 : Ipv6Address = addr_from_string('0A0B:FF00:0000:0000:0000:0000:FFFF:0000')
    addr3 : Ipv6Address = addr_from_string('0A0B:00FF:0000:0000:0000:0000:FFFF:0000')
    addr4 : Ipv6Address = addr_from_string('0A0A:0001:0000:0000:0000:0000:FFFF:0000')
    for addr in [addr1, addr2, addr3, addr4]:
        net = Ipv6Network(addr1, network_mask_bits=17)
        contains = net.contains(addr)
        if contains:
            print(f'Network [{net}] contains the address [{addr}]')
        else:
            print(f'Network [{net}] does not contain [{addr}]')

if __name__ == '__main__':
    main()

#include <iostream>

using namespace std;

class Set {

public:

    struct Node {
        int value;
        Node* left;
        Node* right;
        Node* parent;
    };

    Set() : root_(nullptr), size_(0) {}

    // –¥—Ä—É–≥–æ–π –≤–∞—Ä–∏–∞–Ω—Ç –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä–∞ –∫–æ–ø–∏—Ä–æ–≤–∞–Ω–∏—è
    /*Set(const Set& other) : root_(nullptr), size_(0) {
        copy(other.root_);
    }*/

    Set(const Set& other) : root_(copy(other.root_, nullptr)), size_(other.size_) {}

    void insert(const int& val) {
        if (root_ == nullptr) {
            root_ = new Node{ val, nullptr, nullptr, nullptr };
            size_++;
            return;
        }
        Node* parent = nullptr;
        Node* node = root_;
        while (node != nullptr && node->value != val) {
            parent = node;
            node = node->value > val ? node->left : node->right;
        }
        if (node == nullptr) {
            node = new Node{ val, nullptr, nullptr, parent };
            parent->value > val ? parent->left = node : parent->right = node;
            size_++;
        }
    }

    void erase(const int& val) {
        Node* parent = nullptr;
        Node* node = root_;
        while (node != nullptr && node->value != val) {
            parent = node;
            node = node->value > val ? node->left : node->right;
        }
        if (node != nullptr) {
            if (node->left == nullptr && node->right == nullptr) {
                if (node == root_) {
                    root_ = nullptr;
                }
                else {
                    node == parent->right ? parent->right = nullptr : parent->left = nullptr;
                }
                delete node;
            }
            else if (node->left == nullptr) {
                node->right->parent = node->parent;
                if (node == root_) {
                    root_ = node->right;
                }
                else {
                    node == parent->right ? parent->right = node->right : parent->left = node->right;
                }
                delete node;
            }
            else if (node->right == nullptr) {
                node->left->parent = node->parent;
                if (node == root_) {
                    root_ = node->left;
                }
                else {
                    node == parent->right ? parent->right = node->left : parent->left = node->left;
                }
                delete node;
            }
            else {
                Node* temp = min(node->right);
                node->value = temp->value;
                if (temp->right != nullptr) {
                    temp->right->parent = temp->parent;
                }
                temp == temp->parent->right ? temp->parent->right = temp->right : temp->parent->left = temp->right;
                delete temp;
            }
            size_--;
        }
    }

    Node* min(Node* node) {
        if (node != nullptr) {
            while (node->left != nullptr) {
                node = node->left;
            }
        }
        return node;
    }

    Node* max(Node* node) {
        if (node != nullptr) {
            while (node->right != nullptr) {
                node = node->right;
            }
        }
        return node;
    }

    void print() {
        print(root_);
        cout << endl;
    }

    int size() const {
        return size_;
    }

    void clear() {
        clear(root_);
        root_ = nullptr;
        size_ = 0;
    }

    ~Set() {
        clear(root_);
    }

private:

    // –¥—Ä—É–≥–æ–π –≤–∞—Ä–∏–∞–Ω—Ç copy
    /*void copy(Node* node) {
        if (node != nullptr) {
            insert(node->value);
            copy(node->left);
            copy(node->right);
        }
    }*/

    Node* copy(Node* node, Node* parent) {
        if (node == nullptr) {
            return nullptr;
        }
        Node* temp = new Node{ node->value, nullptr, nullptr, parent };
        temp->left = copy(node->left, temp);
        temp->right = copy(node->right, temp);
        return temp;
    }

    void clear(Node* node) {
        if (node != nullptr) {
            clear(node->left);
            clear(node->right);
            delete node;
        }
    }

    void print(Node* node) {
        if (node != nullptr) {
            print(node->left);
            cout << node->value << " ";
            // —Ä–∞—Å–∫–æ–º–º–µ–Ω—Ç–∏—Ä–æ–≤–∞—Ç—å –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ –ø–æ—Å—Ç—Ä–æ–µ–Ω–∏—è –¥–µ—Ä–µ–≤–∞
           /* cout << " value " << node->value << " ";
            if (node->parent) {
                cout << " parent " << node->parent->value;
            }
            else {
                cout << '\t';
            }
            if (node->left) {
                cout << " left " << node->left->value;
            }
            else {
                cout << '\t';
            }
            if (node->right) {
                cout << " right " << node->right->value;
            }
            else {
                cout << '\t';
            }
            cout << " " << node << endl;*/
            print(node->right);
        }
    }

    Node* root_;
    int size_;
};


int main() {

    int arr[]{ 45,30,50,27,39,90,15,70,103 };

    Set st;

    for (int i = 0; i < 9; i++) {
        st.insert(arr[i]);
    }

    st.print();
    cout << st.size() << endl;

    st.erase(15);
    st.erase(50);
    st.erase(45);

    st.print();
    cout << st.size() << endl;

    Set st2(st);

    st2.print();
    cout << st2.size() << endl;

}

