"use client"
import { Button } from '@/components/ui/button'
import { acceptFriendRequest, friendRequest, rejectFriendRequest } from '@/app/addfriend/actions'
import { Check, X } from 'lucide-react'
import { Avatar, AvatarFallback, AvatarImage } from '../ui/avatar'
import { useState } from 'react'

interface Props {
	requests: Array<friendRequest> | undefined
}

export default function FriendRequests(props: Props) {
	const [requests, setRequests] = useState(props.requests);

	if (requests === undefined || requests.length <= 0) {
		return <h2 className="text-sm font-semibold">no pending friend requests</h2>
	}

	return (
		<div>
			{requests.map((request) => {
				return <div key={request.id} className='flex justify-between'>
					<div className='flex items-center gap-4'>
						<Avatar>
							<AvatarImage src={request.profile.avatarUrl ?? undefined} />
							<AvatarFallback>{request.profile.username!.substring(0, 2)}</AvatarFallback>
						</Avatar>
						{request.profile.username}
					</div>
					<div className='flex items-center gap-4' >
						<Button size="icon" variant={"secondary"} className={"rounded-full w-6 h-6"} onClick={async () => {
							setRequests(requests.filter(r => r.id !== request.id))
							await rejectFriendRequest(request.id);
						}}><X className='w-4 h-4' /></Button>

						<Button size="icon" variant={"default"} className={"rounded-full w-6 h-6"} onClick={async () => {
							setRequests(requests.filter(r => r.id !== request.id))
							await acceptFriendRequest(request.id);
						}}><Check className='w-4 h-4' /></Button>
					</div>
				</div>
			})}
		</div>
	)
}

import java.util.Scanner;
import java.util.Arrays;
public class ArrayAct1
{
    public static void main(String args[]){
        Scanner in = new Scanner(System.in);
        
        int i; // counter for index
        int[] arr = new int[8];
        int[] even = new int[8];
        int[] neweven = new int[8];
        int[] odd = new int[8];
        int countEven = 0, sumEven = 0, lowest, highest;
        double aveEven;
               
        System.out.println("Enter 8 numbers: ");
        for(i = 0; i < arr.length; i++){
            arr[i] = in.nextInt(); // read all numbers from the user         
            
            // get all even numbers from the list
            
            if(arr[i] % 2 == 0){
                sumEven += arr[i]; // kung even ang number, i add ko sa sumEven
                countEven++; // mag increment ang countEven
                even[i] = arr[i]; // ilagay sa even na array tanan even numbers from the list
            }
        }
        
        lowest = arr[0];
        highest = arr[0];
        
        for(i = 0; i < arr.length; i++){
            if(arr[i] < lowest){
                lowest = arr[i];
            }
            
            if(arr[i] > highest){
                highest = arr[i];
            }
        }
        
        //Compute the average of all even
        aveEven =(double) sumEven / countEven;
        
        System.out.print("No. of Even: "+countEven);
        System.out.print("[");
        // this loop will eliminate zeroes in even array
        for(i = 0; i < even.length; i++){
            if(even[i] > 0){
                System.out.print(even[i]+ ",");
            }
        }
        System.out.println("]");
        System.out.println("Sum of Even: "+sumEven);
        System.out.println("Ave of Even: "+aveEven);
        System.out.println("Highest: "+highest);
        System.out.println("Lowest: "+lowest);
    }
}

