import numpy as np
import pandas as pd
from sklearn.linear_model import LinearRegression
from sklearn.ensemble import GradientBoostingClassifier, RandomForestClassifier
from sklearn.model_selection import train_test_split, cross_val_score

from pathlib import Path
from tqdm.notebook import tqdm


DATA_DIR = Path("dataset/MovieLens_25M")
assert DATA_DIR.exists() and DATA_DIR.is_dir()
RATINGS_PATH = DATA_DIR / "ratings.csv"
assert RATINGS_PATH.exists() and RATINGS_PATH.is_file()


ratings = pd.read_csv(RATINGS_PATH, usecols=["userId", "movieId", "rating"]).rename(
    columns={"userId": "uid", "movieId": "mid", "rating": "val"}
)


uids = ratings["uid"].unique()
mids = ratings["mid"].unique()
uid_map = {uid: i for i, uid in enumerate(uids)}
mid_map = {mid: i for i, mid in enumerate(mids)}
ratings["uid"] = ratings["uid"].map(uid_map)
ratings["mid"] = ratings["mid"].map(mid_map)


ratings["val"] = ratings["val"] > 3.5


train, test = train_test_split(ratings, test_size=0.2)


class GBDT:
    def __init__(self):
        self.model = GradientBoostingClassifier(
            n_estimators=10, max_depth=10, verbose=True
        )

    def fit(self, X, y):
        self.model.fit(X, y)

    def transform(self, X):
        return self.model.apply(X)


class RF:
    def __init__(self):
        self.model = RandomForestClassifier(n_estimators=10, max_depth=10, verbose=True)

    def fit(self, X, y):
        self.model.fit(X, y)

    def transform(self, X):
        return self.model.apply(X)


class GBDT_LR:
    def __init__(self):
        self.gbdt = GBDT()
        self.lr = LinearRegression()

    def fit(self, X, y):
        self.gbdt.fit(X, y)
        X_gbdt = self.gbdt.transform(X)
        X_gbdt = X_gbdt.reshape(X_gbdt.shape[0], -1)
        self.lr.fit(X_gbdt, y)

    def predict(self, X):
        X_gbdt = self.gbdt.transform(X)
        X_gbdt = X_gbdt.reshape(X_gbdt.shape[0], -1)
        return self.lr.predict(X_gbdt)


class RF_LR:
    def __init__(self):
        self.rf = RF()
        self.lr = LinearRegression()

    def fit(self, X, y):
        self.rf.fit(X, y)
        X_rf = self.rf.transform(X)
        X_rf = X_rf.reshape(X_rf.shape[0], -1)
        self.lr.fit(X_rf, y)

    def predict(self, X):
        X_rf = self.rf.transform(X)
        X_rf = X_rf.reshape(X_rf.shape[0], -1)
        return self.lr.predict(X_rf)


gbdtlr = GBDT_LR()
gbdtlr.fit(train[["uid", "mid"]].values, train["val"].values)


rflr = RF_LR()
rflr.fit(train[["uid", "mid"]].values, train["val"].values)


gbdt_test = gbdtlr.predict(test[["uid", "mid"]].values)
rf_test = rflr.predict(test[["uid", "mid"]].values)


acc_gbdt = (gbdt_test > 0.5) == test["val"]
acc_rf = (rf_test > 0.5) == test["val"]


gbdt_acc = acc_gbdt.sum() / len(acc_gbdt)
rf_acc = acc_rf.sum() / len(acc_rf)
print(f"GBDT+LR accuracy: {gbdt_acc:.4f}")
print(f"RF+LR accuracy: {rf_acc:.4f}")

