% Par√¢metros
u0 = 0;     % Condi√ß√£o de contorno em x=0 
uL = 1;     % Condi√ß√£o inicial 
phi = 1;    % Porosidade
V = 1;      % Velocidade 
D = 1;      % Coeficiente de difus√£o 
L = 1;      % Comprimento caracter√≠stico 

dx=0.01;
dt=0.01;

x = 0:dx:L; % Malha espacial 
t = 0:dt:1; % Malha temporal
nx = length(x);
nt = length(t);

u = zeros(nx, nt);

% Condi√ß√£o inicial
for n=1:nt
    u(1,n) = u0;
    u(L,n) = uL;
end

% Itera√ß√£o no tempo
for n = 1:nt-1
    for i = 2:nx-1
        u(i,n+1) = u(i+1,n)*((D*dt)/(phi*dx^2)) + u(i,n)*(1 - (V*dt)/(phi*dx) - (2*D*dt)/(phi*dx^2)) ...
            + u(i-1,n)*((V*dt)/(phi*dx) + (D*dt)/(phi*dx^2));
    end    
end

% Plot
plot(x, u);
xlabel('x');
ylabel('C');
